import React from 'react'
import {Box,User,Form} from './Hero.Elements'; 
import TextField from '@material-ui/core/TextField';
import { FaBeer } from 'react-icons/fa';



function Hero() {
    return (
        <>
          <Box>
                <User>
                User Login
                </User>
                <Form>
                  
                <TextField
          style={{ margin: 8 }}
          placeholder=  {<FaBeer />} 
          fullWidth 
          margin="normal"
          InputLabelProps={{
            shrink: true,
          }}
          />
                </Form>
           </Box>
        </>
    )
}
export default Hero;
